import '../styles/footer.css';
import { useState, useEffect } from 'react';

function Footer() {
  const email = "alfonsojmoragav@gmail.com";
  const [copied, setCopied] = useState(false);
  const [hovered, setHovered] = useState(false);
  const [snakeUrl, setSnakeUrl] = useState(null);

  const copyToClipboard = () => {
    navigator.clipboard.writeText(email).then(() => {
      setCopied(true);
      setTimeout(() => setCopied(false), 2000);
    });
  };

  const loadSnake = async () => {
    try {
      const res = await fetch(`https://raw.githubusercontent.com/poncho-ajmv/poncho-ajmv/output/github-snake-dark.svg?${Date.now()}`);
      const blob = await res.blob();
      const objectUrl = URL.createObjectURL(blob);
      setSnakeUrl(objectUrl);
    } catch (err) {
      console.error('Error cargando snake:', err);
    }
  };

  useEffect(() => {
    loadSnake();
    const timer = setTimeout(loadSnake, 12 * 60 * 60 * 1000);
    return () => clearTimeout(timer);
  }, []);

  return (
    <footer className="footer contact-footer">
      <h2 className="contact-title">SOCIALS <span className="at-icon">@</span></h2>
      <p className="contact-subtitle">Letâ€™s connect and build something cool ðŸš€</p>

      <div className="contact-grid">
        <a className="contact-box linkedin" href="https://linkedin.com/in/poncho-ajmv" target="_blank" rel="noreferrer">
          <img src="https://cdn-icons-png.flaticon.com/512/174/174857.png" alt="LinkedIn" className="icon" /> Linkedin
        </a>
        <a className="contact-box github" href="https://github.com/poncho-ajmv" target="_blank" rel="noreferrer">
          <img src="https://cdn-icons-png.flaticon.com/512/25/25231.png" alt="GitHub" className="icon" /> Github
        </a>
        <a className="contact-box discord" href="https://discord.com/users/957722095381540874" target="_blank" rel="noreferrer">
          <img src="https://cdn-icons-png.flaticon.com/512/2111/2111370.png" alt="Discord" className="icon" /> Discord
        </a>
      </div>

      <h4 className="email-heading">ðŸ“¬ Send me an email</h4>
      <div className="footer-form-style">
        <input type="text" value={email} disabled />
        <a href={`mailto:${email}`} className="icon-button" title="Enviar">âž¤</a>
        <div
          className="tooltip-container"
          onMouseEnter={() => setHovered(true)}
          onMouseLeave={() => setHovered(false)}
          onClick={copyToClipboard}
        >
          <button className="icon-button">{copied ? 'âœ…' : 'ðŸ“‹'}</button>
          {hovered && (
            <span className="tooltip">{copied ? 'Copied' : 'Copy'}</span>
          )}
        </div>
      </div>

      {snakeUrl && (
        <>
          <h3 className="ascii-separator"># GitHub Contributions</h3>
          <div className="github-snake">
            <img
              alt="GitHub Snake Animation"
              src={snakeUrl}
              className="snake-img"
              loading="lazy"
              decoding="async"
            />
          </div>
        </>
      )}

      <p className="made-by">
        <span className="made-by-label">[INFO]</span> by <strong className="author-name">@poncho_ajmv</strong>
      </p>
    </footer>
  );
}

export default Footer;
